import React , { useEffect , useState } from 'react';

function Usuario () {
	
	const [ usuario , setUsuario ] = useState();
	
	useEffect(() => {
		fetch( "https://randomuser.me/api/" )
		.then( x => x.json() )
		.then( x => {
			var getUsuario = [{
				"seed" : x.info.seed ,
				"test.title" : x.results[ 0 ].name.title ,
				"nombre" : x.results[ 0 ].name.first ,
				"apellido" : x.results[ 0 ].name.last ,
				"genero" : x.results[ 0 ].gender ,
				"celular" : x.results[ 0 ].cell ,
				"edad" : x.results[ 0 ].dob.age ,
				"imagen_large" : x.results[ 0 ].picture.large ,
			}];
			
			console.log( x.results[0] );
			console.log( `
				Seed: ${ getUsuario.seed } ,
				Genero: ${ getUsuario.genero } ,
				Telefono: ${ getUsuario.celular } ,
				Edad: ${ getUsuario.edad } ,
				Imagen: ${ getUsuario.imagen_large } ,
			` );
			
			setUsuario( getUsuario );
			
		});
	},[]);

	return ( 
		<section className="usuario">
			<h2>Usuario</h2>
			<div className="elusuario">
				{
					usuario?.map((elusuario) => {
						return(
							<div key={elusuario.genero}>
								<img src={ elusuario.imagen_large } alt={ elusuario.nombre } />
							</div>
						);
					})
				}
				
				
				{/* 
				{
					u_nombre?.map(( uni ) => {
						return(
							<div className="universidad" key={ uni.nombre }>
								<p>{ uni.nombre }</p>
								<p>
									<a target="_blank" href={ uni.web } rel="noreferrer">{ uni.dominio }</a>
								</p>
							</div>
						)
					})
				}
				 */}
				
				
				
				
			</div>
		</section>
	)
};

export default Usuario;
